function InputSample() {
  const [inputs, setInputs] = useState({
    name: '',
    nickname: ''
  })
  const {name, nickname} = inputs;

  const onChange = e => {
    const {name, value} = e.target;
    setInputs({
      ...inputs,
      [name]: value
    })
  }


  return (
    <>
     <input placeholder="이름" name="name" value="" onChange={onChange}/>
     <input placeholder="닉네임" name="nickname"/>
     <button>초기화</button>
     <div>
      <strong>값:()</strong>
     </div>
    </>
  )
}

